-- ----------------------------
-- View structure for v_equipcostdocb4
-- ----------------------------
DROP VIEW IF EXISTS `v_equipcostdocb4`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `v_equipcostdocb4` AS select `ecost`.`sTaskId` AS `sTaskId`,`ecost`.`equipmentName` AS `eName`,'购置' AS `eType`,`ecost`.`functionAndTechnology` AS `eFunction`,`ecost`.`unitPrice` AS `eUnitPrice`,`ecost`.`quantity` AS `eQuality`,`ecost`.`totalPrice` AS `eTotalPrice`,if((`ecost`.`type` = '0'),'国拨','自筹') AS `eFrom`,`ecost`.`purchaseCompany` AS `ePCompany`,`ecost`.`setCompany` AS `eSCompany`,'' AS `ebuyType`,'' AS `eCreateCompany`,'' AS `eEquitType`,'' AS `eOpenDirection`,'' AS `eUsed` from `obj_equipmentpurchasepost` `ecost` union select `tcost`.`sTaskId` AS `sTaskId`,`tcost`.`equipmentName` AS `eName`,'购置' AS `eType`,`tcost`.`functionAndTechnology` AS `eFunction`,`tcost`.`unitPrice` AS `eUnitPrice`,`tcost`.`quantity` AS `eQuality`,`tcost`.`totalPrice` AS `eTotalPrice`,if((`tcost`.`type` = '0'),'国拨','自筹') AS `eFrom`,`tcost`.`trialCompany` AS `ePCompany`,`tcost`.`setCompany` AS `eSCompany`,'' AS `ebuyType`,'' AS `eCreateCompany`,'' AS `eEquitType`,'' AS `eOpenDirection`,'' AS `eUsed` from `obj_trialproductionequipmentcost` `tcost`; ;

