-- View structure for v_itemtorequiredetail
-- ----------------------------
DROP VIEW IF EXISTS `v_itemtorequiredetail`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `v_itemtorequiredetail` AS select `t_itemlist`.`itemEnglishName` AS `itemEnglishName`,`t_itemlist`.`showItemEnglishName` AS `showItemEnglishName`,`t_itemrequriment`.`value` AS `value`,`t_itemrequriment`.`affiliation` AS `affiliation`,`t_itemrequriment`.`sort1` AS `sort1`,`t_itemrequriment`.`state` AS `state`,`t_itemlist`.`itemFatherId` AS `itemFatherId`,`t_itemlist`.`itemName` AS `itemName`,`t_itemlist`.`id` AS `id` from (`t_itemlist` join `t_itemrequriment` on((`t_itemlist`.`id` = `t_itemrequriment`.`itemId`))); ;

