-- View structure for v_partandpartitem
-- ----------------------------
DROP VIEW IF EXISTS `v_partandpartitem`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `v_partandpartitem` AS select `obj_participant`.`participantName` AS `participantName`,`obj_participant`.`sort1` AS `partSort`,`obj_participantitem`.`itemListId` AS `itemListId`,`obj_participantitem`.`sort1` AS `itemSort`,`obj_participantitem`.`allSelfCateMoney` AS `allSelfCateMoney`,`obj_participantitem`.`allCountryCateMoney` AS `allCountryCateMoney`,`obj_participant`.`taskId` AS `taskId`,`obj_participantitem`.`id` AS `id`,`obj_participantitem`.`participantId` AS `participantId`,`obj_participant`.`subTaskId` AS `subTaskId` from (`obj_participant` join `obj_participantitem` on((`obj_participant`.`id` = `obj_participantitem`.`participantId`))); ;

