-- View structure for v_subtask_tasktoitem
-- ----------------------------
DROP VIEW IF EXISTS `v_subtask_tasktoitem`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `v_subtask_tasktoitem` AS SELECT
obj_subtask.subTaskName AS subTaskName,
obj_tasktoitem.itemListId AS itemListId,
obj_tasktoitem.allCountryCateMoney AS allCountryCateMoney,
obj_tasktoitem.allSelfCateMoney AS allSelfCateMoney,
obj_tasktoitem.countryCalculateExplain AS countryCalculateExplain,
obj_tasktoitem.selfCalculateExplain AS selfCalculateExplain,
obj_tasktoitem.sort1 AS tasktoitemsort,
obj_tasktoitem.selfSettlement AS selfSettlement,
obj_tasktoitem.countrySettlement AS countrySettlement,
obj_subtask.taskId AS taskId,
obj_subtask.sort1 AS subTasksort,
obj_subtask.respnoseCompanyName,
obj_subtask.id AS sTaskId,
t_itemlist.itemEnglishName,
t_itemlist.itemName
FROM
(obj_subtask
JOIN obj_tasktoitem ON ((obj_tasktoitem.sTaskId = obj_subtask.id)))
INNER JOIN t_itemlist ON obj_tasktoitem.itemListId = t_itemlist.id; ;

